INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (1000, 2, 2, "訓練はまだ\nここからですわ", "vo_minigame_1013_icon_1_002_001", "vo_minigame_1013_icon_2_002_001", 1, 2, "調子が上がって\nきたなっ", 3000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (5000, 2, 2, "クスクス、悪くない\n流れですわね", "vo_minigame_1013_icon_1_003_001", "vo_minigame_1013_icon_2_003_001", 2, 2, "ほらほら、\nまだいけるだろ？", 3000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (10000, 2, 2, "すばらしい\n記録ですわ", "vo_minigame_1013_icon_1_004_001", "vo_minigame_1013_icon_2_004_001", 3, 3, "へへっ、おまえら\nやるじゃねえか！", 3000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (10000, 3, 2, "乗りに乗って\nいますわね", "vo_minigame_1013_icon_1_005_001", "vo_minigame_1013_icon_2_005_001", 4, 3, "あたしたちはまだ\n止まらねえぜ！", 3000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (10000, 3, 2, "まだまだ行きます\nついてきなさい", "vo_minigame_1013_icon_1_005_002", "vo_minigame_1013_icon_2_005_002", 5, 3, "見てろよ！\nマコト班の快進撃だ！", 3000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (10000, 3, 2, "エリコ班の\n本領発揮ですわ！", "vo_minigame_1013_icon_1_005_003", "vo_minigame_1013_icon_2_005_003", 6, 3, "うおぉぉっ！\n絶好調だぜ！", 3000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (0, 4, 2, "ここからは\n前人未到の領域です！", "vo_minigame_1013_icon_1_006_001", "vo_minigame_1013_icon_2_006_001", 7, 3, "どこまで行けるか\n楽しみだなっ！", 3000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (1, 5, 3, "厄介でしたわ…", "vo_minigame_1013_icon_1_007_001", "vo_minigame_1013_icon_2_007_001", 8, 4, "まだ諦めんなよっ", 1000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (1, 5, 3, "油断大敵です", "vo_minigame_1013_icon_1_007_002", "vo_minigame_1013_icon_2_007_002", 9, 4, "冷やっとしたぜ…！", 1000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (1, 5, 3, "忌々しいっ…", "vo_minigame_1013_icon_1_007_003", "vo_minigame_1013_icon_2_007_003", 10, 4, "弱音を吐くなっ", 1000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (99, 6, 4, "大所帯ですわね", "vo_minigame_1013_icon_1_008_001", "vo_minigame_1013_icon_2_008_001", 11, 3, "マコト班集合！", 1500);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (99, 6, 4, "エリコ班へようこそ", "vo_minigame_1013_icon_1_008_002", "vo_minigame_1013_icon_2_008_002", 12, 3, "連携してくぞ！", 1500);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (0, 8, 1, "ナナカちゃんに\nお任せあれ", "vo_minigame_1013_icon_1_020_001", "vo_minigame_1013_icon_2_020_001", 13, 6, "みんなに力を！", 3000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (0, 9, 1, "はっはっは！\n任せろ！", "vo_minigame_1013_icon_1_022_001", "vo_minigame_1013_icon_2_022_001", 14, 7, "任せてくれたまえ", 3000);
INSERT INTO `v1_53b3fad03582a183eb7cd68538a0695380f8fc6b701c5e70305d7b65d550dcc2` VALUES (0, 10, 1, "どんどんいくわよ", "vo_minigame_1013_icon_1_023_001", "vo_minigame_1013_icon_2_023_001", 15, 8, "ほな、いきまひょか", 3000);
